CREATE DEFINER=`u956355532_tallerg`@`127.0.0.1` PROCEDURE `CalculateDailyMetrics` ()   BEGIN
    DECLARE EXIT HANDLER FOR SQLEXCEPTION
    BEGIN
        ROLLBACK;
        RESIGNAL;
    END;

    START TRANSACTION;
    
    -- Insertar métricas del día anterior
          WHERE estado = 'Entregado o Instalado' 
          AND DATE(fecha_entrega) = DATE_SUB(CURDATE(), INTERVAL 1 DAY)), 'productividad'),
        
        (DATE_SUB(CURDATE(), INTERVAL 1 DAY), 'tiempo_promedio_horas',
