DELIMITER $$
CREATE TRIGGER `track_prediction_accuracy` AFTER UPDATE ON `ordenes_trabajo` FOR EACH ROW BEGIN
    -- Cuando una orden se completa, buscar si había predicción y calcular precisión
    IF NEW.estado = 'Entregado o Instalado' AND OLD.estado != 'Entregado o Instalado' THEN
        UPDATE prediction_metrics 
        SET 
            tiempo_real_horas = TIMESTAMPDIFF(HOUR, NEW.fecha_creacion, NEW.fecha_entrega),
            fecha_completado = NOW(),
            error_absoluto = ABS(tiempo_predicho_horas - TIMESTAMPDIFF(HOUR, NEW.fecha_creacion, NEW.fecha_entrega)),
            error_porcentual = CASE 
                WHEN tiempo_predicho_horas > 0 THEN 
                    ABS(tiempo_predicho_horas - TIMESTAMPDIFF(HOUR, NEW.fecha_creacion, NEW.fecha_entrega)) / tiempo_predicho_horas * 100
                ELSE 0 
            END
        WHERE orden_id = NEW.id 
        AND fecha_completado IS NULL;
    END IF;
END
$$
DELIMITER ;

